import './App.css';
import 'semantic-ui-css/semantic.min.css'
import React from 'react'
import { Dropdown } from 'semantic-ui-react'

const getOptions = [
  { key: '1', text: 'Resturant 1', value: '1' },
  { key: '2', text: 'Resturant 2', value: '2' },
  { key: '3', text: 'Resturant 3', value: '3' },
  { key: '4', text: 'Resturant 4', value: '4' },
  { key: '5', text: 'Resturant 5', value: '5' },
  { key: '6', text: 'Resturant 6', value: '6' },
  { key: '7', text: 'Resturant 7', value: '7' },
  { key: '8', text: 'Resturant 8', value: '8' },
  { key: '9', text: 'Resturant 9', value: '9' },
  { key: '10', text: 'Resturant 10', value: '10' },
]

function App() {
  return (
    <div className="App">
  <Dropdown
      multiple
      search
      selection
      options={getOptions}
      placeholder='I stay open on change'
    />
    </div>
  );
}

export default App;
